import { Link } from "react-router-dom"

export default function NoteItem({ID, Title, Note, Date}){

    return(

        <Link to={'/EditAndSave:'+ID}>
        <div className="noteCard">
            <div className="noteHeading">{Title}</div>
            <div className="noteDate">{Date}</div>
            <div className="notePreview">{Note}</div>
        </div>    
        </Link>
    )

}
